<script>
    function alpineInstance() {
        return {
            isLoading: false,
            isError: false,
            error: '',
            all_lands: [],
            lands_num: '',
            my: [],
            mySecond: [],
            pageNum: 1,
            maxPrice: 500,
            minPrice: 1,
            walletSearch: localStorage.getItem("address") || '',
            walletSearchSecond: '',

            smartContract: false,
            auction: false,
            offers: true,
            listing: true,
            async loadData(){
                localStorage.setItem('address', this.walletSearch);
                this.pageNum = 1;
                this.isLoading = true;
                this.all_lands = [];
                this.lands_num = '';
                this.my = [];
                this.mySecond = [];

                this.types = [];

                if(this.auction == true){
                    this.types.push("auction");
                }
                if(this.offers == true){
                    this.types.push("offer");
                }
                if(this.listing == true){
                    this.types.push("listing");
                }

                while(1){
                    const payload = {
                        nsfw: false,
                        page: this.pageNum,
                        priceMin: this.minPrice * 1000000,
                        priceMax: (parseInt(this.maxPrice) + 1) * 1000000,
                        project: "Pavia",
                        search: "",
                        sold: false,
                        sort: {_id: -1},
                        verified: true,
                        smartContract: this.smartContract,
                        types: this.types
                    };

                    await axios.post("https://api.cnft.io/market/listings", payload)
                    .then((res) => {
                        lands = [...res.data.results];
                        if (lands.length != 0){
                            lands.forEach(land => {   
                                this.all_lands.push({
                                    x: land.asset.metadata['-----Land Sale 1-----'][1].x,
                                    y: land.asset.metadata['-----Land Sale 1-----'][2].y,
                                    'price': land['price'] / 1000000,
                                    'id': land['_id']
                                });
                            });
                        }
                    })
                    .catch((err) => {
                        console.log("Error Page: ", this.pageNum, " Error: ", err);
                        this.isError = true;
                    });
                    this.pageNum += 1;

                    if (lands.length == 0){
                        await axios.get(`https://api.pool.pm/wallet/${this.walletSearch}`, {timeout: 10000})
                        .then((res) => {
                            tokens = [...res.data.tokens];
                            lands = tokens.filter(land => { return land.policy === '4bf184e01e0f163296ab253edd60774e2d34367d0e7b6cbc689b567d' });

                            lands.forEach(land => {
                                let my_x = land.metadata['-----Land Sale 1-----'][1].x;
                                let my_y = land.metadata['-----Land Sale 1-----'][2].y;
                                this.my.push({x: my_x, y: my_y});
                            });
                        })
                        .catch((err) => {
                            console.log("Error: ", err);
     
                        });

                        await axios.get(`https://api.pool.pm/wallet/${this.walletSearchSecond}`, {timeout: 10000})
                        .then((res) => {
                            tokens = [...res.data.tokens];
                            lands = tokens.filter(land => { return land.policy === '4bf184e01e0f163296ab253edd60774e2d34367d0e7b6cbc689b567d' });

                            lands.forEach(land => {
                                let my_x = land.metadata['-----Land Sale 1-----'][1].x;
                                let my_y = land.metadata['-----Land Sale 1-----'][2].y;
                                this.mySecond.push({x: my_x, y: my_y});
                            });
                        })
                        .catch((err) => {
                            console.log("Error: ", err);
     
                        });

                        this.isLoading = false;
                        this.lands_num = this.all_lands.length.toString();
                        this.plotData();
                        var element = document.getElementById("scatterplot");
                        element.classList.remove("hidden");
                        break;
                    }
                }
            },
            plotData(){
                var svg = d3.select("svg"),
                        margin = 200,
                        width = svg.attr("width") - margin,
                        height = svg.attr("height") - margin
                
                svg.selectAll("g").remove();

                var xScale = d3.scaleLinear().domain([-160, 160]).range([0, width]),
                    yScale = d3.scaleLinear().domain([-185, 135]).range([height, 0]);
                    
                var g = svg.append("g")
                    .attr("transform", "translate(" + 100 + "," + 100 + ")");
                d3.select('body').append('div').attr('id', 'tooltip').attr('style', 'position: absolute; opacity: 0; color: red; font-weight: bold; background-color: black; padding: 5px 5px 5px 5px; display: none');

                // sea
                svg.append('g')
                    .selectAll("dot")
                    .data(this.sea)
                    .enter()
                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )
                    .attr("cy", function (d) { return yScale(d.y); } )
                    .attr("r", 3.3)
                    .attr("transform", "translate(" + 100 + "," + 100 + ")")
                    .style("fill", "#7ebbcc")

                // deep sea

                    .style("fill", "#0E303A")

                // land for sale
                svg.append('g')

                    .data(this.all_lands)
                    .enter()
                    .append("a")
                    .attr("target","_blank", function(d) { return "https://cnft.io/token/" + d.id })
                    .attr("xlink:href", function(d) {return "https://cnft.io/token/" + d.id})
                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )
                    .attr("cy", function (d) { return yScale(d.y); } )
                    .attr("r", 3.3)
                    .attr("transform", "translate(" + 100 + "," + 100 + ")")
                    .style("fill", "#329431")
                    .on('mouseover', function(d) {
                        d3.select('#tooltip').transition().duration(200).style('opacity', 1).style('display', "block").text("x:" + d.x.toString() + " y:" + d.y.toString() + " price:" + d.price.toString()); 
                        d3.select(this).style("cursor", "default"); 
                    })
                    .on('mouseout', function() { 
                        d3.select('#tooltip').style('opacity', 0).style('display', "none"); 
                        d3.select(this).style("cursor", "default");
                    })
                    .on('mousemove', function() {
                        d3.select('#tooltip').style('left', (d3.event.pageX+10) + 'px').style('top', (d3.event.pageY+10) + 'px'); 
                        d3.select(this).style("cursor", "default");
                    });

                // my
                svg.append('g')
                    .selectAll("dot")
                    .data(this.my)
                    .enter()
                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )

                // my second
                svg.append('g')
                    .selectAll("dot")
                    .data(this.mySecond)
                    .enter()
                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )
                    .attr("cy", function (d) { return yScale(d.y); } )
                    .attr("r", 3.3)

                    .on('mouseover', function(d) {
                        d3.select('#tooltip').transition().duration(200).style('opacity', 1).style('display', "block").text("x:" + d.x.toString() + " y:" + d.y.toString());

                    })
                    .on('mousemove', function() {
                        d3.select('#tooltip').style('left', (d3.event.pageX+10) + 'px').style('top', (d3.event.pageY+10) + 'px'); 
                        d3.select(this).style("cursor", "default");
                    });


            },
